(function () {
    var app = angular.module('inspinia', [
        'dc.endlessScroll',
        'ui.router',                    // Routing
        'oc.lazyLoad',                  // ocLazyLoad
        'ui.bootstrap'                 // Ui Bootstrap
    ]);
})();
